import React from "react";
import "./CatalogCard.css";

function CatalogCard() {
    return (
        <div className="cardp" style={{ width: "18rem" }}>
            <div className="card-bodyp">
                <h4 className="card-titlep title">{title}</h4>
                <div className="img-continer">
                    <img
                        src={"https://picsum.photos/500/300"}
                        alt={title + "img"}
                        className="card-imagep"
                    />
                </div>
                <div className="product-info">
                    <div className="card-textp phone">
                        <strong>Tel:</strong> {phone}
                    </div>
                    <div className="card-textp country">
                        <strong>Made in {country}</strong>
                    </div>
                    <div className="price">
                        <strong>Price: </strong>
                        {prise}
                    </div>
                    <div className="size">
                        <strong>Size: </strong>
                        {size}
                    </div>
                </div>
                <div className="control">
                    {/* <i className="fa-solid fa-eye">
                        <span className="view-num">0</span>
                    </i> */}
                    <i className="fa-solid fa-bag-shopping"></i>
                </div>
            </div>
        </div>
    );
}

export default CatalogCard;
